import './stylesheets/App.css';
import './stylesheets/Home/QrCode.css'
import './stylesheets/Home/Navbar.css'


import QR from './components/home/QR-Code/QR'
import Navbar from './components/home/Navbar/Navbar';

function App() {
  return (
    <div className="App">
      <header>
        <Navbar></Navbar>
      </header>
      <section id='content'>
        <section>
          <QR></QR>
        </section>
        <section>
        </section>
      </section>
    </div>
  );
}

export default App;
